import React from 'react';
import './index.css';

const ScriptView = ({ generatedScript, part1, part2, part3, part4 }) => {
  return (
    <div className="script-view-container">
      <h1 className="title">Generated Script</h1>
      <textarea className="generated-script" value={generatedScript} readOnly cols="50" rows="20"/>

      /<h2>Part 1</h2>
      <textarea className="generated-script" value={part1} readOnly cols="50" rows="20"/>

      <h2>Part 2</h2>
      <textarea className="generated-script" value={part2} readOnly cols="50" rows="20"/>

      <h2>Part 3</h2>
      <textarea className="generated-script" value={part3} readOnly cols="50" rows="20"/>

      <h2>Part 4</h2>
      <textarea className="generated-script" value={part4} readOnly cols="50" rows="20"/>
    </div>
  );
};


export default ScriptView;
